import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import { BrowserRouter, Router, Route } from 'react-router-dom';

import Navbar from 'react-bootstrap/esm/Navbar';
import {ink,Switch} from  'react-router-dom'

/*

        <BrowserRouter>
        <NavBer1/>
        <NavBer/>
        <MyRouter/>
        </BrowserRouter>

        */
function App() {
  return (
    <div className="App">
       <Router>
       <Navbar/>
       <switch>
         <Route path='/'/>
       </switch>
       </Router>

    </div>
  );
}

export default App;
